import { Section, Typography, Container } from "@toptal/picasso";

import * as S from "./styles";

import ContentLeftMid from "./components/ContentLeftMid";

const ContentLeft = () => {
  return (
    <Section variant="bordered" style={S.contentLeftSection}>
      <Container padded={2} bordered rounded>
        <Typography variant="heading" size="xlarge">
          Box 1 title
        </Typography>

        <ContentLeftMid />

        <Container>
          <Typography variant="heading" size="large">
            This is the content of the first box. It should be aligned to the
            left
          </Typography>
          <Typography>We'll add a form here soon</Typography>
        </Container>
      </Container>
    </Section>
  );
};

export default ContentLeft;
